import styles from "./Books.module.css";
import { useEffect, useState } from "react";
function Books() {
  const [fet, onfet] = useState(false);
  useEffect(() => {
    fetch(
      `https://www.googleapis.com/books/v1/volumes?q=A&key=AIzaSyCDgRAXUYvnfJtU9bAOBlh0SU9Lu7MkhpE`
    )
      .then((e) => {
        return e.json();
      })
      .then((e) => {
        // console.log(e.items);
        onfet(e.items);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div className={styles.books}>
      {fet &&
        fet.forEach((i) => {
          <div className={styles.books1}>{}</div>;
        })}
    </div>
  );
}
export default Books;
